<script>
  import nav_title from './basics_bar'
  import Sender from '../../Sender/sender'
  import cfg from '../../../.cfg'

  export default ({
    name: 'basics3',
    data() {
      return {
        test: '123',
        show_suit: true,
        show_detail: false,
        page: 1,
        other: {
          other_model: true,
          other_msg: '',
          other_number: 1
        },
        save_state: 0,
        submit_state: 0,
        plan__: 20,
        plan: true,
      }
    },
    methods: {
      show_max_suit: function () {
        this.show_suit = false;
        this.show_detail = true;
      },
      page_minus: function () {
        this.page--;
      },
      page_add: function () {
        this.page++;
      },
      push_other: function () {
        this.other.other_number++;
        this.new_house.regulation.push(this.other);
      },
      rm_other(data) {
        let me = this;
        this.new_house.regulation.forEach(function (item, index) {
          if (item.other_number == data) {
            me.new_house.regulation.splice(index);
          }
        })
      },
      submit_() {
        this.submit_state = 1;
      },
      save_() {
        this.save_state = 1;
      },
      open3() {
        this.$notify({
          title: '添加成功',
          message: '为您跳转详情页',
          type: 'success'
        });
      },
      open6() {
        this.$notify.error({
          title: '错误',
          message: '失败了,试着刷新一下页面进行重新添加,点击左上角回主页'
        });
      },
    },
    watch: {
      'new_house.regulation': {
        handler() {
          this.other = {
            other_model: true,
            other_msg: '',
          }
        },
        deep: true,
      },
      page: function (val) {
        if (val == 2) {
          this.plan__ = 40;
        } else if (val == 3) {
          this.plan__ = 60;
        } else if (val == 4) {
          this.plan__ = 80;
        } else if (val == 5) {
          this.plan__ = 100;
        }
      },
      submit_state: function () {
        let me =this;
        Sender.post(cfg.api + '/api/house/add', this.new_house)
          .then(function (data) {
            if (data.success) {
              me.open3();
              me.$router.push({path:'/house_material/'+data.data.id});

            } else {
              me.open6();
            }
          })
      },
      save_state: function () {
        // this.$router.push({path:''})
      },

    },

    components: {
      nav_title: nav_title,
    },

    computed: {
      new_house: function () {
        return this.$store.getters['get_new_house'];
      }
    }
  });


</script>


